import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import '/reserve.css'


export const Reserve = ({setOpen, hotelId}) => {
  return (
    <div ClassName = "reserve">
        <div className="rcontainer">
            <FontAwesomeIcon 
            icon={faCircleXmark} 
            className="rclose"
            onClick={() => setOpen(false)}
            />
            <span>Select your rooms:</span>
             
        </div>
    </div>
  );
};
